5. **Play the generated audio**: Play the audio returned by the ElevenLabs.io API.

### Step 1: Set up a new Rust project

First, create a new Rust project using Cargo:

```bash
cargo new clipboard_tts
cd clipboard_tts
```

### Step 2: Add necessary dependencies

Edit your `Cargo.toml` file to include the necessary dependencies:

```toml
[dependencies]
clipboard = "0.6"
reqwest = { version = "0.11", features = ["json"] }
tokio = { version = "1", features = ["full"] }
serde = { version = "1.0", features = ["derive"] }
serde_json = "1.0"
rodio = "0.15"
```

- `clipboard`: For accessing the clipboard.
- `reqwest`: For making HTTP requests to the ElevenLabs.io API.
- `tokio`: An asynchronous runtime for Rust.
- `serde` and `serde_json`: For JSON serialization and deserialization.
- `rodio`: For playing audio.

### Step 3: Implement clipboard reading

