### Step 4: Integrate with ElevenLabs.io API

Create a function to send the clipboard content to the ElevenLabs.io API and retrieve the audio:

```rust
use reqwest::Client;
use serde::Serialize;

#[derive(Serialize)]
struct ElevenLabsRequest {
    text: String,
    voice: String,
    // Add other required fields as per ElevenLabs.io API documentation
}

async fn get_tts_audio(text: String) -> Result<Vec<u8>, Box<dyn std::error::Error>> {
    let client = Client::new();
    let api_key = "your_elevenlabs_api_key"; // Replace with your actual API key
    let url = "https://api.elevenlabs.io/v1/text-to-speech";

    let request_body = ElevenLabsRequest {
        text,
        voice: "default".to_string(), // Replace with the desired voice
    };

    let response = client
        .post(url)
        .header("xi-api-key", api_key)
        .json(&request_body)
        .send()
        .await?;

    if response.status().is_success() {
        let audio_data = response.bytes().await?.to_vec();
        Ok(audio_data)
    } else {
        Err(format!("Failed to get TTS audio: {}", response.status()).into())
    }
}
```

