### Updated Solution

Here's an updated version of the `Layout` component that uses Tailwind CSS's utility classes more idiomatically:

```jsx
import React from 'react';

const Layout = ({ children, variant }) => {
  const baseClasses = 'px-4 mx-auto';
  const fullWidthClasses = 'w-full';
  const centeredClasses = 'max-w-6xl';

  const classes = variant === 'full-width' ? `${baseClasses} ${fullWidthClasses}` : `${baseClasses} ${centeredClasses}`;

  return <div className={classes}>{children}</div>;
};

export default Layout;
```

### Explanation

1. **Base Classes**: The `baseClasses` variable contains the common styles for both variants: `px-4` for padding on the x-axis and `mx-auto` for centering the element horizontally.

2. **Full-Width Classes**: The `fullWidthClasses` variable contains the `w-full` class, which makes the element take up the full width of its parent container.

3. **Centered Classes**: The `centeredClasses` variable contains the `max-w-6xl` class, which sets the maximum width of the element to 1200px.

4. **Conditional Classes**: The `classes` variable conditionally combines the base classes with either the full-width or centered classes based on the `variant` prop.

This approach ensures that the component is both flexible and easy to maintain.

